Short answer: Kumagai Gumi doesn’t disclose a separate figure for “domestic private building construction” backlog at FY2023 Q4. The closest disclosed data are:

* \#Building backlog at year-end (total, not split public/private): **¥381,142 million** (FY2023, i.e., year ended Mar 31, 2024).&#x20;
* For context, the report does break down **completed** building work (not backlog) in FY2023 into public vs. private: **Public ¥28,159m**, **Private ¥199,639m** (sum = ¥227,799m). This is not backlog, but it’s the only public/private split provided.&#x20;

If you need an estimate for the domestic-private slice of backlog, say the word and I’ll derive one transparently from these disclosures (with the necessary caveats).

